      this.state = {content: "", widgets: "", ReadingRisk: false, ContentHeading: "", ContentBody: "", HideSearchBar: true, SearchText: "", SearchModal: false };
      this.HeaderFunc = this.HeaderFunc.bind(this)
    } 
 
